import React, { useEffect, useState } from "react";
import { useParams } from "react-router";
import { getOrderDetails } from "./APIs/OrdersAPIs";

export default function WayBill(){
    const{ id } = useParams();
    const [orderDetails, setOrderDetails] = useState();

    useEffect(()=>{
        
        getOrderDetails(id).then((orderDetails) => {
            this.setState({orderDetails});
        });
    }, [id]);
    return (
    <div>
        <div>
            <div>logo name mobile</div>
            <div>barcode date</div>
        </div>
        
        <div>
            <div>
                <div>from: </div>
            </div>
            <div>
                <div>to: </div>
                <div>phone / mobile</div>
            </div>
        </div>
        
        <div>
            <div>signature</div>
            <div></div>
        </div>

        <div>
            <div>
                <table>
                    <tr>
                        <td>type</td>
                        <td>weight</td>
                    </tr>
                    <tr>

                    </tr>
                </table>
            </div>
            <div>
                contents / notes
            </div>
        </div>
    </div>)
}
